const Alert = (props) => {
  return (
    <div class="alert alert-warning alert-dismissible fade show" role="alert">
      <h4 class="alert-heading">{props?.alert?.type}</h4>
      <hr></hr>
      <strong>{props?.alert?.message}</strong>
      <button
        type="button"
        class="close"
        data-dismiss="alert"
        aria-label="Close"
      >
        <span aria-hidden="true">&times;</span>
      </button>
    </div>
  );
};

export default Alert;
